import MatchLine from "./MatchLine";

function MatchesCont(props) {
    return (
        <>
            <div className="flex flex-col rounded-lg bg-gray-100">
                <div className="flex flex-col gap-3 p-4 bg-gray-300 rounded-t-lg">
                    <div className="flex  items-center basis-6/12 justify-between">
                        <div className="flex gap-3 items-center">
                            <img className="h-6 object-contain" src={`https://images.fotmob.com/image_resources/logo/teamlogo/${(props?.leagueCountry || "").toLowerCase()}.png`} alt="matchCountryLogo"/>
                            <div className="text-base leading-normal">{props.leagueTitle}</div> 
                        </div>
                        <img className="h-6 w-6 object-contain" src={props.leagueIcon} alt="leagueIcon" />
                    </div>
                </div>
                <div className=" p-4 flex flex-col gap-3 md:gap-6">
                    {props.matchData?.map((match, index) => (
                        <>
                            <MatchLine matchData={match} key={index}/>
                            {index < props.matchData.length - 1 && <div className="border"></div>}
                        </>
                    ))}
                </div>
            </div>
        </>
    );
}

export default MatchesCont;
